import base64
import cv2
import math
import numpy as np
from io import BytesIO
from PIL import Image

def deserialize(data_url):
    bytes = base64.b64decode(data_url)
    nbBytes = len(bytes)
    print('Number of bytes ' + str(nbBytes))
    # img = np.frombuffer(bytes, dtype='int8')

    img = Image.open(BytesIO(bytes))
    dim = (28, 28)
    img = np.array(img)
    print('Vector image shape ' + str(img.shape))

    img = cv2.resize(img, dim, interpolation = cv2.INTER_LINEAR)
    print('Vector image shape after resize ' + str(img.shape))

    cv2.imshow('lol', img)
    cv2.waitKey(0)
    cv2.destroyAllWindows()

